import React from 'react';
import ReactDOM from 'react-dom/client';
//import './styles/index.css';
import '/Users/michaelringelstein/Documents/Perso/Code/freaking_react/src/styles/tailwind.generated.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { Router, Route } from "react-router-dom";
import CreateMission from './Pages/CreateMission';
import ShiftDetail from './Pages/ShiftDetail';
import history from './history';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <div>
  <Router history={history}>
    <Route path="create-mission" component={CreateMission}></Route>
    <Route path="shift-detail" component={ShiftDetail}></Route>
    <Route path="/*" component={App} />
  </Router>
  </div>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
